               <h2 class="first-section__title">
                  О TennisTour
               </h2>
            </div>
         </section>
         
         <section id="about">
            <div class="container">
               <div class="about__block">
                  <div class="about__txt">
                     <h3 class="tennis__title">
                        TennisTour - это серия турниров
                        по теннису среди любителей,
                        проходящих в Санкт-Петербурге
                     </h3>
                     <div class="tennis__prg-small tennis__prg-small">
                        <p>
                           Дата основания - сентябрь 2006 года. Турниры проводятся во всех разрядах (мужском и женском
                           одиночном, мужском и женском парном,
                           а также миксте).Мужской одиночный разряд разделен по уровню
                           игры на 4 категории
                        </p>
                        <p>
                           Серия включает в себя как однодневные турниры (турниры выходного дня), которые проходят по
                           воскресеньям три раза в месяц, так и многодневные турниры (TennisTour Cup), которые длятся
                           около двух месяцев. Ежегодно проводится 4 таких турнира
                        </p>
                     </div>
                  </div>
                  <div class="tournament__img-block">
                     <img src="images/dist/place.png" alt="" class="tournament-img">
                     <div class="tournament__img-bg">
                     </div>
                  </div>
               </div>
               <div class="about__block">
                  <div class="tournament__img-block tournament__img-block_blue">
                     <img src="images/dist/about.png" alt="" class="tournament-img">
                     <div class="tournament__img-bg">
                     </div>
                  </div>
                  <div class="about__txt">
                     <h3 class="tennis__title">
                        <sup>
                           <i class="fas fa-quote-right"></i>
                        </sup>
                        Вступительное слово от вас
                        в 2 строки в формате цитаты
                        <sub>
                           <i class="fas fa-quote-left"></i>
                        </sub>
                     </h3>
                     <div class="tennis__prg-small tennis__prg-small">
                        <p>
                           TennisTour - это Клуб, в котором участники наших турниров,
                           а также гости могут каждый вторник и четверг с 20:00 до 23:00 часов тренироваться, играя на
                           счет в одиночном и парном формате. Действует система абонементов на посещение Клуба
                        </p>
                        <p>
                           Результаты всех без исключения турниров серии TennisTour учитываются в нашем Рейтинге, на
                           основании которого в конце каждого года проводится Итоговый турнир
                           за звание лучшего теннисиста сезона. Кроме того, трижды в год награждаются теннисисты,
                           занявшие призовые места в сезонных Марафонах
                        </p>
